import Link from 'next/link';

const linkStyle = {
  textAlign: 'center',
  display: 'flex',
  marginLeft: 'auto',
  marginRight: 'auto',
  width: '50%'
};
const imgStyle = {
  height: '66vh',
  textAlign: 'center',
  display: 'block',
  marginLeft: 'auto',
  marginRight: 'auto',
  width: '50%'
}
const appStyle = {
  textAlight: 'center'
}

const Header = () => (
  <div style={appStyle}>
    <img src="/dkp.png" style={imgStyle}/>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/events">
      <a style={linkStyle}>Events</a>
    </Link>
    <Link href="/booking">
      <a style={linkStyle}>Booking</a>
    </Link>
  </div>
);

export default Header;
